import { Container } from "react-bootstrap";
function Footer() {
  return (
    <>
      <Container>
        <a
          href="https://portfolio-polu-sai-ashish.web.app/"
          target="_blank"
          rel="noreferrer"
          style={{
            textDecoration: "none",
            color: "white",
          }}
        >
          Know or Contact Me?
        </a>
      </Container>
    </>
  );
}
export default Footer;
